import './Home.css';
import SignUp from './SignUp.jsx';
import LogIn from './LogIn.jsx';
import MyNavbar from './Navbar';
import { Routes, Route, useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();
  const handleGetStarted = () => {
    navigate('/UploadAndDiagnosis'); // Set the path to the new page
  };

  return (
    <div>
      {/* Navbar */}
      <MyNavbar />

      {/* Hero Section */}
      <section className="hero-section">
        <div className="content">
          <h1>"Preserve Nature, Boost Productivity"</h1>
          <p>
            Combining AI and agriculture to deliver sustainable, efficient
            disease detection for healthier yields.
          </p>
          <button onClick={handleGetStarted}>Get Started</button>
        </div>
        <div className="image-content large-screen-only">
          <div className="image-container">
            <img
              src="https://res.cloudinary.com/dgsr46f8t/image/upload/v1732371915/Remove_background_project_wazekw.png"
              alt="Background"
              className="background-image"
            />
            <img
              src="https://res.cloudinary.com/dgsr46f8t/image/upload/v1732377277/file_1_wyzjpu.png"
              alt="Overlay"
              className="overlay-image"
            />
          </div>
        </div>
      </section>

      <hr />

      {/* About Us Section */}
      <div className="about-us-container">
        <h1>About Us</h1>
        <p>
          At <strong>Groot</strong>, we are committed to revolutionizing
          agriculture through the power of technology. Our platform harnesses
          cutting-edge artificial intelligence to detect plant diseases instantly
          from simple images. By bridging the gap between farmers, gardeners, and
          innovative solutions, we aim to empower individuals and communities to
          grow healthier, more sustainable crops.
        </p>
        <div className="mission-points">
          <div className="points-container">
            <div className="mission-point">
              ð± <strong>Preserve Nature</strong>: Helping plants thrive by
              identifying issues early.
            </div>
            <div className="mission-point">
              ð¤ <strong>Support Farmers and Gardeners</strong>: Providing
              accessible, accurate, and actionable insights.
            </div>
            <div className="mission-point">
              ð¡ <strong>Boost Productivity</strong>: Minimizing losses and
              maximizing yields with intelligent disease management.
            </div>
          </div>
          <img
            src="https://res.cloudinary.com/dgsr46f8t/image/upload/v1732435581/-pwC5LXyQJ2KLxAR2wcCA_ml46fg.jpg"
            alt="Agriculture-Image"
            className="mission-image"
          />
        </div>
        <p>
          Join us in transforming the way we care for plants, one leaf at a time.
          Together, we can grow a healthier, greener future!
        </p>
      </div>

      <hr />

      {/* How it Works Section */}
      <div className="how">
        <h1 className="h1">How it works?</h1>
        <div className="tut-content">
          <video controls>
            <source
              src="https://res.cloudinary.com/dgsr46f8t/video/upload/v1732387114/WhatsApp_Video_2024-11-24_at_00.01.32_8136a6c4_nkzwa0.mp4"
