            title="Connect with us on LinkedIn"
          >
            <i className="fab fa-linkedin-in"></i>
          </a>
        </div>
      </div>

      {/* Footer */}
      <div className="container5">
        <div className="sm">Â© 2024 GROOT</div>
        <ul>
          <li>Home</li>
